import React from "react";
import "./popular_slide.css"

const PopularSlide = () => {


    return (
        <div className="body_popular">
            <div className="popular_slide">
                <div className="popular_carrousel">

                </div>

                <a className="switchLeft sliderButton"><i class='bx bxs-chevron-left'></i></a>
                <a className="switchRight sliderButton"> <i class='bx bxs-chevron-right' ></i> </a>
            </div>
        </div>
    )
}

export default PopularSlide;
